// SPDX-License-Identifier: MIT

pragma solidity ^0.8.14;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "./Owner.sol";

contract RankeIco is Owner {
    ERC20 public RankeToken;
    address public Operator; // transferFrom 할 수 있는 소유자의 주소

    constructor(address _RankeToken, address _Operator) {
        RankeToken = ERC20(payable(_RankeToken));
        Operator = _Operator;
    }

    // ORK 토큰 요청
    function ico() public payable {
        // 받는 이더를 고정값으로 하는 경우 비율은 1 ETH == 10000 ORK
        require(1 ether == msg.value, "Only 1 ether");
        // uint checkWei = msg.value / 2;
        // require(checkWei * 2 == msg.value);

        // 트랜잭션 요청자에게 10000 ORK 전송
        RankeToken.transferFrom(Operator, msg.sender, 10000 ether);
    }

    // ico 완료 후 보관 중인 이더 출금
    function withdrawEth(address to) public onlyOwner {
        // 해당 주소로 보관 중인 이더 전체 전송
        address payable receiver = payable(to);
        receiver.transfer(address(this).balance);
    }
}
